import React from "react";
import { NavLink } from "react-router-dom";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
function Team() {
  return (
    <div class="card">
      <h1>John Doe</h1>
      <p class="title">CEO Founder, Example</p>
      <p>Harvard University</p>
      <p>
        <button>Contact</button>
      </p>
    </div>
  );
}

export default Team;
